_body: !!python/object:github.GithubObject._ValuedAttribute
  value: "* skip redundant check (all input arrays are at that point instances of\
    \ _ndarray_)\r\n* use _dtype_ instead of _dtype.str_\r\n\r\nThere is an improvement\
    \ of ~3% \r\n\r\n```\r\n\xB7 Running 14 total benchmarks (2 commits * 1 environments\
    \ * 7 benchmarks)\r\n[  0.00%] \xB7 For numpy commit 18435496 <master> (round\
    \ 1/2):\r\n[  0.00%] \xB7\xB7 Building for virtualenv-py3.6-six..\r\n[  0.00%]\
    \ \xB7\xB7 Benchmarking virtualenv-py3.6-six\r\n[  3.57%] \xB7\xB7\xB7 Running\
    \ (bench_records.Records.time_fromarrays_formats_as_list--).......\r\n[ 25.00%]\
    \ \xB7 For numpy commit 2c402b5c <danielhrisca-fromarrays> (round 1/2):\r\n[ 25.00%]\
    \ \xB7\xB7 Building for virtualenv-py3.6-six..\r\n[ 25.00%] \xB7\xB7 Benchmarking\
    \ virtualenv-py3.6-six\r\n[ 28.57%] \xB7\xB7\xB7 Running (bench_records.Records.time_fromarrays_formats_as_list--).......\r\
    \n[ 50.00%] \xB7 For numpy commit 2c402b5c <danielhrisca-fromarrays> (round 2/2):\r\
    \n[ 50.00%] \xB7\xB7 Benchmarking virtualenv-py3.6-six\r\n[ 53.57%] \xB7\xB7\xB7\
    \ bench_records.Records.time_fromarrays_formats_as_list                      \
    \                                           83.4\xB10.4ms\r\n[ 57.14%] \xB7\xB7\
    \xB7 bench_records.Records.time_fromarrays_formats_as_string                 \
